import React, { useState, useEffect } from "react";
import "./States.css";

const States = () => {
  const [states, setStates] = useState([]);
  const [newState, setNewState] = useState({
    Name: "",
    Device: "",
    Condition: "",
    Parameter: "",
  });

  useEffect(() => {
    fetch("/api/states")
      .then((res) => res.json())
      .then((data) => setStates(data))
      .catch((err) => console.log(err));
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewState((prevState) => ({ ...prevState, [name]: value }));
  };

  const handleAddState = (e) => {
    e.preventDefault();
    fetch("/api/states", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(newState),
    })
      .then((res) => res.json())
      .then((data) => {
        setStates((prevState) => [...prevState, data]);
        setNewState({ Name: "", Device: "", Condition: "", Parameter: "" });
      })
      .catch((err) => console.log(err));
  };

  return (
    <div className="states-page">
      <h1>States</h1>
      <table className="states-table">
        <thead>
          <tr>
            <th>State Name</th>
            <th>Device</th>
            <th>Condition</th>
            <th>Parameter</th>
          </tr>
        </thead>
        <tbody>
          {states.map((state) => (
            <tr key={state._id}>
              <td>{state.Name}</td>
              <td>{state.Device}</td>
              <td>{state.Condition}</td>
              <td>{state.Parameter}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <form className="add-state-form" onSubmit={handleAddState}>
        <h2>Add a New State</h2>
        <div className="input-field">
          <label htmlFor="stateName">State Name:</label>
          <input
            type="text"
            id="stateName"
            name="Name"
            value={newState.Name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="input-field">
          <label htmlFor="device">Device:</label>
          <input
            type="text"
            id="device"
            name="Device"
            value={newState.Device}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="input-field">
          <label htmlFor="condition">Condition:</label>
          <input
            type="text"
            id="condition"
            name="Condition"
            value={newState.Condition}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="input-field">
          <label htmlFor="parameter">Parameter:</label>
          <input
            type="text"
            id="parameter"
            name="Parameter"
            value={newState.Parameter}
            onChange={handleInputChange}
            required
          />
        </div>
        <button type="submit">Add State</button>
      </form>
    </div>
  );
};

export { States };
